INSERT INTO `infracoes` (`id`, `slug`, `title`, `nome_infracoes`, `horas_infracoes`, `infracoes_infracoes`, `descricao_infracoes`, `categoria_infracoes`, `visivel_infracoes`, `utilizador_infracoes`, `criado_infracoes`, `modificado_infracoes`) VALUES
(0, '', '', '', NULL, '', '', '', NULL, '', NULL, NULL),
(27, 'abertura-ou-fecho-de-turno-incorretamente', 'Abertura ou Fecho de Turno incorretamente', 'Regulamento UE 165/2014, nº 7 do Artigo 34º', NULL, 'Os condutores introduzem no tacógrafo digital o símbolo do país em que iniciarem o dia de trabalho e o símbolo do país em que o terminarem. Todavia, os Estados-Membros podem impor aos condutores dos veículos que efetuem transportes internos no seu território que,  ao símbolo do país, acrescentem outras especificações de caráter geográfico, desde que as tenham notificado à Comissão antes de 1 de abril de 1998.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(28, 'mais-de-24h-no-interior-do-tac??grafo', 'Mais de 24h no interior do tacógrafo', 'Regulamento UE 165/2014, nº 1 do Artigo 34º', NULL, 'Os condutores utilizam as folhas de registo ou os cartões de condutor sempre que conduzirem, a partir do momento em que tomem o veículo a seu cargo. A folha de registo ou o cartão de condutor não podem ser retirados antes do fim do período de trabalho diário, a menos que esta operação seja autorizada de outra forma. Nenhuma folha de registo ou cartão de condutor pode ser utilizado por um período mais longo do que aquele para o qual foi destinado.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(29, 'dois-discos-no-mesmo-dia', 'Dois discos no mesmo dia', 'Regulamento UE 165/2014, nº 1 do Artigo 34º', NULL, 'Os condutores utilizam as folhas de registo ou os cartões de condutor sempre que conduzirem, a partir do momento em que tomem o veículo a seu cargo. A folha de registo ou o cartão de condutor não podem ser retirados antes do fim do período de trabalho diário, a menos que esta operação seja autorizada de outra forma. Nenhuma folha de registo ou cartão de condutor pode ser utilizado por um período mais longo do que aquele para o qual foi destinado.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(30, 'disco-rasurado', 'Disco rasurado', 'Regulamento UE 165/2014, Nº 2 do Artigo 34º', NULL, 'Os condutores protegem adequadamente as folhas de registo e os cartões de condutor e não utilizam folhas de registo nem cartões sujos ou danificados.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(31, 'disco-mal-preenchido', ' Disco mal preenchido', 'Regulamento UE 165/2014, Nº 6 do Artigo 34º', NULL, 'Os condutores de veículos equipados com tacógrafo analógico anotam na folha de registo as seguintes indicações: a) Nome e apelido, no início da utilização da folha de registo; b) Data e lugar do início e do fim da utilização da folha de registo; c) Número de matrícula do veículo a que o condutor está afeto, no início da primeira viagem registada na folha de registo e, em seguida, em caso de mudança de veículo, durante a utilização da folha de registo; d) Leitura do conta-quilómetros: i) no início da primeira viagem registada na folha de registo, ii) no fim da última viagem registada na folha d', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(32, 'falta-de-comuta????o', 'Falta de comutação', 'Regulamento UE 165/2014, nº alínea b) do Nº 5 do Artigo 34º', NULL, 'Acionam os dispositivos de comutação que permitem registar separada e distintamente os seguintes períodos: i) Sob o símbolo do volante : o tempo de condução: ii) Sob o símbolo dos martelos : outros tempos de trabalho; iii) Sob o símbolo do quadrado: o tempo de disponibilidade: iv) Sob o símbolo da cama : as interrupções da condução e os períodos de repouso diário.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(33, 'falta-de-entradas-adicionais', 'Falta de entradas adicionais', 'Regulamento UE 165/2014, nº alínea b) do Nº 3 do Artigo 34º', NULL, 'Ser inscritos no cartão de condutor, utilizando a possibilidade de introdução manual oferecida pelo tacógrafo, se o veículo estiver equipado com um tacógrafo digital.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(34, 'desloca????es', 'Deslocações', 'Regulamento CE 561/2006 Artigo 9º, n. 3', NULL, 'O tempo gasto por um condutor que viaje como condutor de um veículo não abrangido pelo presente regulamento para se deslocar para ou de um veículo abrangido pelo presente regulamento que não esteja junto à residência do~condutor ou junto à empresa onde o condutor está normalmente baseado será contado como «outro trabalho».', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(35, 'falta-de-descanso-di??rio-regular', 'Falta de descanso diário Regular', 'Regulamento CE 561/2006 Artigo 8º, n. 4', NULL, 'O condutor pode fazer, no máximo, três períodos de repouso diário reduzido entre cada dois períodos de repouso semanal.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(36, 'falta-de-descanso-di??rio-trip-multipla', 'Falta de descanso diário Trip Multipla', 'Regulamento CE 561/2006 Artigo 8º, n. 5', NULL, 'Não obstante o disposto no n.o 2, o condutor de um veículo com tripulação múltipla deve gozar um novo período de repouso diário de pelo menos 9 horas nas 30 horas que se sigam ao termo de um período de repouso diário ou semanal.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(37, 'falta-de-descanso-di??rio', 'Falta de descanso diário', 'Regulamento CE 561/2006 Artigo 8º, n. 2', NULL, 'O condutor deve gozar um novo período de repouso diário dentro de cada período de 24 horas após o final do período de repouso diário ou semanal precedente.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(38, 'dois-fds-reduzidos-seguidos', 'Dois FDS reduzidos seguidos', 'Regulamento CE 561/2006 Artigo 8º, n. 6', NULL, 'Em cada período de duas semanas consecutivas, o condutor deve gozar pelo menos: — dois períodos de repouso semanal regular, ou — um período de repouso semanal regular e um período de repouso semanal reduzido de,  no mínimo, 24 horas. Todavia, a redução deve ser compensada mediante um período de repouso equivalente, gozado de uma só vez, ntes do final da terceira semana a  contar da semana em questão.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(39, 'falta-de-pausa', 'Falta de pausa', 'Regulamento CE 561/2006 Artigo 7º', NULL, 'Após um período de condução de quatro horas e meia, o condutor gozará uma pausa ininterrupta de pelo menos 45 minutos, a não ser que goze um período de repouso Esta pausa pode ser substituída por uma pausa de pelo menos 15 minutos seguida de uma pausa de pelo menos 30 minutos', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(40, 'abertura-de-tac??grafo', 'Abertura de tacógrafo', 'Regulamento UE 165/2014, nº 1 do Artigo 34º', NULL, 'Os condutores utilizam as folhas de registo ou os cartões de condutor sempre que conduzirem, a partir do momento em que tomem o veículo a seu cargo. A folha de registo ou o cartão de condutor não podem ser retirados antes do fim do período de trabalho diário, a menos que esta operação seja autorizada de outra forma. Nenhuma folha de registo ou cartão de condutor pode ser utilizado por um período mais longo do que aquele para o qual foi destinado.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(41, 'excesso-de-trabalho-sem-pausas', 'Excesso de trabalho sem pausas', 'Decreto Lei 237/2007, nº 2 do artigo 8º', NULL, 'Os trabalhadores móveis não podem prestar mais de seis horas de trabalho consecutivo.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(42, 'limites-e-dura????o-do-trabalho', 'Limites e duração do trabalho', 'Decreto Lei 237/2007, nº 5 do artigo 6º', NULL, 'A duração do trabalho, incluindo trabalho suplementar, no caso de abranger, no todo ou em parte, o intervalo entre as 0 e as 5 horas, não pode exceder dez horas por dia.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(43, 'intervalo-de-descanso', ' Intervalo de descanso', 'Decreto Lei 237/2007, nº 1 do artigo 8º', NULL, 'O período de trabalho diário dos trabalhadores móveis é interrompido por um intervalo de descanso de duração não inferior a trinta minutos, se o número de horas de trabalho estiver compreendido entre seis e nove, ou a quarenta e cinco minutos, se o número de horas for superior a nove.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(44, 'excesso-de-condu????o-semanal', 'Excesso de condução semanal', 'Regulamento CE 561/06, nº 2 do Artigo 6º', NULL, 'O tempo semanal de condução não pode exceder 56 horas e não pode implicar que seja excedido o tempo de trabalho semanal máximo previsto na Directiva 2002/15/CE.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(45, 'excesso-de-condu????o-quinzenal', 'Excesso de condução quinzenal', 'Regulamento CE 561/06, nº 3 do Artigo 6º', NULL, 'O tempo de condução total acumulado por cada período de duas semanas consecutivas não deve exceder 90 horas.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(46, 'excesso-de-tempo-de-trabalho-semanal', 'Excesso de tempo de trabalho semanal', 'Directiva 2002/15/CE, alinea a) do artigo 4º', NULL, 'O tempo médio de trabalho semanal não exceda 48 horas. O tempo máximo de trabalho semanal pode ser alargado para 60 horas desde que num período de quatro meses, não seja excedida uma média de 48 horas semanais.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(47, 'excesso-de-condu????o-di??ria', 'Excesso de condução diária', 'REGULAMENTO (CE) nº 561/2006 nº 1 do artigo 6', NULL, 'O tempo diário de condução não deve exceder 9 horas. No entanto, não mais de duas vezes por semana, o tempo diário de condução pode ser prolongado até um máximo de 10 horas.', '', '1', 1, '1', '2019-04-09', '2019-04-09'),
(48, 'sem-infrac????es-detetadas', 'Sem Infracções Detetadas', 'De acordo com o regulamento legal e no período analisado não foram detetadas quaisquer infracções do Condutor.', NULL, 'De acordo com o regulamento legal e no período analisado não foram detetadas quaisquer infracções do Condutor.', '', '1', 1, '1', '2019-05-04', '2019-05-04');
